import React from "react";
import {Link} from "react-router-dom"

function Navbar(){
    let userId = 5;
    let reservationId = 5;
    return(
        <div>
            <ul>
                <li><Link to= "/">Home</Link></li>
                <li><Link to = {{pathname : '/users/' + userId}}>My Profile</Link></li>
                <li> <Link to = {{ pathname: '/reservations/' + reservationId}}>Reservations</Link></li>
                <li> <Link to = "/tournaments">Tournaments</Link></li>
                <li> <Link to = "/sportcenters">SportCenters</Link></li>
                <li> <Link to = "/contact">Contact</Link></li>


            </ul>
        </div>
    )
}

export default Navbar;
